import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link as ScrollLink } from 'react-scroll';

const Header = () => {
  return (
    <AppBar position="static" style={{ backgroundColor: 'transparent', color: 'black', boxShadow: 'none' }}>
      <Toolbar>
        <Typography variant="h6" style={{ flexGrow: 1 }}>
          My Portfolio
        </Typography>
        <Button component={ScrollLink} to="home" smooth={true} duration={500} color="inherit">Home</Button>
        <Button component={ScrollLink} to="AboutMe" smooth={true} duration={500} color="inherit">About</Button>
        <Button component={ScrollLink} to="Projects" smooth={true} duration={500} color="inherit">Projects</Button>
        <Button component={ScrollLink} to="Contact" smooth={true} duration={500} color="inherit">Contact</Button>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
